import React, { useState, useEffect } from 'react';

const App = () => {
    const [image, setImage] = useState(null);
    const [text, setText] = useState('');
    const [status, setStatus] = useState('Idle');
    const [recipes, setRecipes] = useState([]);
    const [selectedRecipe, setSelectedRecipe] = useState(null);
    const [errorMessage, setErrorMessage] = useState('');
    const [isDarkMode, setIsDarkMode] = useState(true);
    const [activePage, setActivePage] = useState('home');
    const [imageLoading, setImageLoading] = useState({});
    const [userProfile] = useState({
        name: 'Paula',
        email: 'paula@zylker.com',
        userId: '630083685',
        dietPlan: 'Your custom diet plan will appear here after a recommendation is generated.',
        weeklyGoal: 'N/A'
    });

    const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000';

    useEffect(() => {
        const hash = window.location.hash.replace('#', '').toLowerCase() || 'home';
        setActivePage(hash);
    }, []);

    const handleNavClick = (page) => {
        const formattedPage = page.toLowerCase().replace(' ', '-');
        window.location.hash = formattedPage;
        setActivePage(formattedPage);
    };

    const handleImageChange = (event) => {
        if (event.target.files && event.target.files[0]) {
            setImage(event.target.files[0]);
            setText('');
            setRecipes([]);
            setSelectedRecipe(null);
            setErrorMessage('');
            setStatus('Image selected');
            setImageLoading({});
        }
    };

    const processImage = async () => {
        setErrorMessage('');
        if (!image) {
            setErrorMessage('Please select an image first.');
            return;
        }
        setStatus('Uploading and processing...');
        setText('');
        setRecipes([]);
        setSelectedRecipe(null);
        setImageLoading({});

        try {
            const formData = new FormData();
            formData.append('image', image);
            const ocrResponse = await fetch(`${API_URL}/ocr`, { method: 'POST', body: formData });
            if (!ocrResponse.ok) throw new Error(`OCR failed: ${ocrResponse.status}`);
            const ocrData = await ocrResponse.json();
            const extractedText = ocrData.text || '';
            setText(extractedText);

            const ingredients = extractedText
                .toLowerCase()
                .split(/\s*[\r\n-]\s*/)
                .map(item => item.replace(/^\d+(\.\d+)?\s*(cups?|tbsp|tsp|oz|g|kg|lb)?\s*/i, ''))
                .map(item => item.replace(/\b(and|or|with|to|taste)\b\s*/g, ''))
                .filter(item => item.trim() !== '' && item.length > 2);

            if (ingredients.length === 0) {
                setStatus('No valid ingredients found in the image.');
                return;
            }

            setStatus('Searching recipes...');
            const recipesResponse = await fetch(`${API_URL}/get_recipes`, {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({ ingredients })
            });
            if (!recipesResponse.ok) throw new Error(`Recipes failed: ${recipesResponse.status}`);
            const recipesData = await recipesResponse.json();
            setRecipes(recipesData.recipes || []);
            setImageLoading(recipesData.recipes?.reduce((acc, r) => ({ ...acc, [r.id]: true }), {}) || {});
            setStatus('Complete!');
        } catch (error) {
            setErrorMessage(error.message);
            setStatus('An error occurred.');
            setRecipes([]);
            setImageLoading({});
        }
    };

    const fetchRecipeDetails = async (id) => {
        setStatus('Fetching recipe details...');
        setErrorMessage('');
        setImageLoading(prev => ({ ...prev, [id]: true }));
        try {
            const response = await fetch(`${API_URL}/get_recipe_details/${id}`);
            if (!response.ok) throw new Error('Failed to fetch recipe details');
            const details = await response.json();
            setSelectedRecipe(details);
            setStatus('Details loaded!');
        } catch (err) {
            setErrorMessage('Failed to load details.');
            setStatus('Failed.');
        } finally {
            setImageLoading(prev => ({ ...prev, [id]: false }));
        }
    };

    const goBackToList = () => {
        setSelectedRecipe(null);
        setStatus('Complete!');
    };

    const toggleDarkMode = () => setIsDarkMode(prev => !prev);

    const theme = isDarkMode
        ? { bg: 'bg-gray-900', text: 'text-white', card: 'bg-gray-700', button: 'bg-gray-700 text-gray-200', subheading: 'text-purple-300' }
        : { bg: 'bg-gray-100', text: 'text-gray-900', card: 'bg-gray-200', button: 'bg-gray-300 text-gray-800', subheading: 'text-indigo-500' };

    const renderPage = () => {
        switch (activePage) {
            case 'home':
                if (selectedRecipe) {
                    return (
                        <div>
                            <button onClick={goBackToList}>← Back to Recipes</button>
                            <h2 className={theme.subheading}>{selectedRecipe.title}</h2>
                            <img src={selectedRecipe.image} alt={selectedRecipe.title} />
                            <div>
                                <h3>Nutrition</h3>
                                <p>Calories: {selectedRecipe.nutrients?.calories || 'N/A'}</p>
                                <p>Protein: {selectedRecipe.nutrients?.protein || 'N/A'}</p>
                                <p>Carbs: {selectedRecipe.nutrients?.carbohydrates || 'N/A'}</p>
                                <p>Fat: {selectedRecipe.nutrients?.fat || 'N/A'}</p>
                            </div>
                            <div>
                                <h3>Ingredients</h3>
                                <ul>{selectedRecipe.ingredients?.map((ing, i) => <li key={i}>{ing}</li>)}</ul>
                            </div>
                            <div>
                                <h3>Instructions</h3>
                                <div dangerouslySetInnerHTML={{ __html: selectedRecipe.instructions || 'N/A' }} />
                            </div>
                        </div>
                    );
                }
                return (
                    <div>
                        <input type="file" onChange={handleImageChange} accept="image/*" />
                        <button onClick={processImage} disabled={!image}>Find Recipes</button>
                        {text && <pre>{text}</pre>}
                        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
                            {recipes.map(r => (
                                <div key={r.id} className={theme.card} onClick={() => fetchRecipeDetails(r.id)}>
                                    <img src={r.image} alt={r.title} />
                                    <p>{r.title}</p>
                                </div>
                            ))}
                        </div>
                        {status === 'Complete!' && recipes.length === 0 && <p>No recipes found.</p>}
                    </div>
                );
            case 'profile':
                return (
                    <div>
                        <h2 className={theme.subheading}>My Profile</h2>
                        <p>Name: {userProfile.name}</p>
                        <p>Email: {userProfile.email}</p>
                        <p>Diet Plan: {userProfile.dietPlan}</p>
                        <p>Weekly Goal: {userProfile.weeklyGoal}</p>
                    </div>
                );
            default:
                return <div>Page not found</div>;
        }
    };

    return (
        <div className={`${theme.bg} ${theme.text} min-h-screen p-4`}>
            <header className="flex justify-between items-center mb-6">
                <h1>PlanMyPlate</h1>
                <button onClick={toggleDarkMode}>{isDarkMode ? '🌞 Light Mode' : '🌙 Dark Mode'}</button>
            </header>
            <nav className="flex space-x-4 mb-6">
                {['Home', 'Profile'].map(page => (
                    <button key={page} onClick={() => handleNavClick(page.toLowerCase())}>{page}</button>
                ))}
            </nav>
            <main>{renderPage()}</main>
        </div>
    );
};

export default App;
